INSERT INTO `clase` VALUES (1,'Methanococci','Boone 2001','\nMethanococci (Methanococci) are a class of methanogenic archaea of ​​the Euryarchaeota phylum. They can be mesophilic, thermophilic or hyperthermophilic.','Cavalier-Smith, T (2002). «The neomuran origin of archaebacteria, the negibacterial root of the universal tree and bacterial megaclassification». Int. J. Syst. Evol. Microbiol. 52 (Pt 1): 7-76. PMID 11837318.\nWoese, CR; Kandler O; Wheelis ML (1990). «Towards a natural system of organisms: proposal for the domains Archaea, Bacteria, and Eucarya». Proc. Natl. Acad. Sci. USA 87 (12): 4576-4579. PMC 54159. PMID 2112744. doi:10.1073/pnas.87.12.4576.','2018-03-11 14:16:27',NULL),(2,'Thermoprotei','Garrity et al. (2001 and 2003)','The Thermoprotei is a class of the Crenarchaeota.\nThermoprotei are known to inhabit environments such as hot springs, ocean vents, and geysers which are inhospitable to many other forms of life.\nThough certain species of Thermoprotei use oxygen in respiration, most of the metabolisms of these archaea are anaerobic. Moreover, most of these archaea are also chemolithotrophs, meaning that they must take their energy from inorganic sources. Hydrogen sulfide, hydrogen, methane, sulfur, and nitrogen are all potential energy sources for chemolithotrophs. A particularly high number of species reduce sulfur and various sulfates for energy, particularly those which inhabit solfataric fields. Solfataric fields, composed of soils heated up by volcanic emissions from magma chambers, are known for their high elemental sulfur content.','Yan L, Yu D, Hui N, Naanuri E, Viggor S, Gafarov A, Sokolov SL, Heinaru A, Romantschuk M. Distribution of Archaeal \n Communities along the Coast of the Gulf of Finland and Their Response to Oil Contamination. Front Microbiol. 2018 Jan\n23;9:15. doi: 10.3389/fmicb.2018.00015. eCollection 2018. PubMed PMID: 29410652; \nPubMed Central PMCID: PMC5787342.','2018-03-11 14:18:15',NULL),(3,'Alphaproteobacteria','Garrity et al. 2006','Alphaproteobacteria is a class of bacteria in the phylum Proteobacteria (See also bacterial taxonomy). Its members are highly diverse and possess few commonalities, but nevertheless share a common ancestor. Like all Proteobacteria, its members are Gram-negative and some of its intracellular parasitic members lack peptidoglycan and are consequently gram variable.\nThe Alphaproteobacteria is a diverse taxon and comprises several phototrophic genera, several genera metabolising C1-compounds (e.g., Methylobacterium spp.), symbionts of plants (e.g., Rhizobium spp.), endosymbionts of arthropods (Wolbachia) and intracellular pathogens (e.g. Rickettsia). Moreover, the class includes (as an extinct member) the protomitochondrion, the bacterium that was engulfed by the eukaryotic ancestor and gave rise to the mitochondria, which are organelles in eukaryotic cells (See endosymbiotic theory).] A species of technological interest is Rhizobium radiobacter (formerly Agrobacterium tumefaciens): scientists often use this species to transfer foreign DNA into plant genomes. Aerobic anoxygenic phototrophic bacteria, such as Pelagibacter ubique, are alphaproteobacteria that are a widely distributed marine plankton that may constitute over 10% of the open ocean microbial community.',' Ramsby BD, Hoogenboom MO, Whalan S, Webster NS. Elevated seawater temperature\ndisrupts the microbiome of an ecologically important bioeroding sponge. Mol Ecol.\n2018 Feb 23. doi: 10.1111/mec.14544. [Epub ahead of print] PubMed PMID: 29473977.\n\n Advances in Alphaproteobacteria Research and Application: 2012 Edition: ScholarlyPaper (en inglés).\n ScholarlyEditions. 26 de diciembre de 2012. ISBN 9781481625746.\n','2018-03-11 14:21:24',NULL),(4,'Cyanophyceae\n','Gomont, 1892\n\n\n\n','Cyanophyceae is a primitive group of algae, consists of 150 genera and about 2,500 species. In India, the division is represented by 98 genera and about 833 species. Members of the class Myxophyceae (Cyanophyceae) are commonly known as blue green algae. The name blue green algae is given because of the presence of a domi¬nant pigment c-phycocyanin, the blue green pigment.\nIn addition, other pigments like chloro¬phyll a (green), c-phycoerythrin (red), β-carotene and different xanthophylls are also present. The members of this class are the simplest living autotrophic prokaryotes.They have the following important charac¬teristics:\na. Nucleus is of prokaryotic nature i.e., devoid of nuclear membrane and nucle¬olus,\nb. Absence of well-organised cell orga¬nelles, and\nc. Pigments are distributed throughout the chromoplasm (the outer part of proto¬plasm).\nDepending on the above prokaryotic cha¬racteristics many microbiologists consider the members of Cyanophyceae as bacteria. Based on prokaryotic cell structure like bacteria, Christensen (1962) placed both Cyanophyta and bacteria under a common phylum Prokaryota. Cyanophyta or blue green algae have also been named as cyanobacteria.\n\nImportant Characteristics of Cyanophyceae:\nThe important characteristics of the division are as follows:\n1. The individual cells are prokaryotic in nature. The nucleus is incipient type and they lack membrane bound organelles.\n2. Both vegetative and reproductive cells are non-flagellate.\n3. Cell wall is made up of microfibrils and is differentiated into four (4) layers. The cell wall composed of mucopeptide, along with carbohydrates, amino acids and fatty acids.\n4. Locomotion is generally absent, but when occurs, it is of gliding or jerky type.\n5. The principal pigments are chlorophylls a (green), c-phycocyanin (blue) and c-phyco- erythrin (red). In addition, other pigments like β-carotene and different xanthophylls like myxoxanthin and myxoxanthophyll are also present.\n6. Membrane bound chromatophore are absent. Pigments are found embedded in thylakoids.\n7. The reserve foods are cyanophycean starch and cyanophycean granules (protein).\n8. Many filamentous members possess specia¬lized cells of disputed function (supposed to be the centre of N2 fixation) known as heterocysts.\n9. Reproduction takes place by vegetative and asexual methods. Vegetative reproduction takes place by cell division, fragmentation etc. Asexual reproduction takes place by endospores, exospores, akinetes, nannospores etc.\n10. Sexual reproduction is completely absent. Genetic recombination is reported in 2 cases.\n\nOccurrence of Cyanophyceae:\nMembers of Cyanophyceae are available in different habitats. Most of the species are fresh water (e.g., Oscillatoria, Rivularia), a few are marine (e.g., Trichodesmium, Darmocarpa), and some species of Oscillatoria and Nostoc are grown on terrestrial habitat.',' Sluchanko NN, Slonimskiy YB, Maksimov EG. Features of Protein-Protein\nInteractions in the Cyanobacterial Photoprotection Mechanism. Biochemistry\n(Mosc). 2017 Dec;82(13):1592-1614. doi: 10.1134/S000629791713003X. Review. PubMed\nPMID: 29523061.\n\n Herrero, A. & Flores, E, (editores). (2008). The Cyanobacteria: Molecular Biology, Genomics and Evolution\n (1st edición). Caister Academic Press. ISBN 978-1-904455-15-8 .\n Enrique Flores AH (2008). The Cyanobacteria: Molecular Biology, Genomics and Evolution. Horizon. p. 3. ISBN 1-904455-15-8.\n Falcón LI, Magallón S y Castillo A. 2010. Dating the cyanobacterial ancestor of the chloroplast.\n ISME J. 2010 Jun;4(6):777-83. doi: 10.1038/ismej.2010.2. Epub 2010 Mar 4.\n\n8-0\n Cavalier-Smith, T. 2002. The neomuran origin of archaebacteria, the negibacterial root of the \nuniversal tree and bacterial megaclassification. Int. J. Syst. Evol. Microbiol., 52: 7-76.','2018-03-11 14:25:40',NULL),(5,'Deinococci','L. Margulis & K.V. Schwartz, 1998','','No data available.','2018-03-11 14:10:45',NULL),(6,'Spirochaetia','Paster 2011','The class Spirochaetia was originally proposed by Paster 2011. This name replaces the name Spirochaetes Cavalier-Smith 2002 non Spirochaetes Garrity and Holt 2001 . ','Paster, B.J. 2011. Class I. Spirochaetia class. nov. In: N.R. Krieg, J.T. Staley, D.R. Brown, B.P. Hedlund, B.J. Paster, N.L. Ward, W. Ludwig, and W.B. Whitman (eds.)\n Bergey\'s Manual of Systematic Bacteriology, 2nd ed., vol. 4 (The Bacteroidetes, Spirochaetes, Tenericutes (Mollicutes), Acidobacteria, Fibrobacteres, Fusobacteria,\n Dictyglomi, Gemmatimonadetes, Lentisphaerae, Verrumicrobia, Chlamydiae, and Planctomycetes), Springer-Verlag, New York. p. 471.','2018-03-11 14:26:36',NULL);
