INSERT INTO `dominio` VALUES (1,'Eukarya','Carl Woese et al. 1977','Eukarya is one of the three domains of life contianing organisms whose cells contain complex structures enclosed within complex membranes call endomembranes. These organisms are called Eukaryotes and are either singular- or multiple-celled. The defining membrane-bound structure that differentiates eukaryotic cells from prokaryotic cells is the cell nucleus, within which the genetic material and many other cell bodies are contained. The presence of a nucleus gives eukaryotes their name that derives from the Greek (eu, \"good\") and (karyon, \"kernel\"). Most eukaryotic cells also contain other membrane-bound organelles  Eukaryotic Cell Endomembranesuch as mitochondria, chloroplasts and the Golgi apparatus. All species of large complex organisms are eukaryotes, including animals, plants and fungi, although most species of eukaryote are protist microorganisms. Domain Eukaryota is taxonomically devided into seven kingdoms.\nCell division in eukaryotes is different from prokaryotes that lack a nucleus. It involves separating the duplicated chromosomes, through movements directed by microtubules. There are two types of division processes. In mitosis, one cell divides to produce two genetically identical cells. In meiosis, which is required in sexual reproduction, one diploid cell (having two instances of each chromosome, one from each parent) undergoes recombination of each pair of parental chromosomes, and then two stages of cell division, resulting in four haploid cells (gametes). Each gamete has just one complement of chromosomes, each a unique mix of the corresponding pair of parental chromosomes. Eukaryotes appear to be monophyletic, comprising one of the three domains of life; Bacteria and Archaea are prokaryotes that have none of the characteristics. Eukaryotes represent a tiny minority of all living things. It could well be said that the eukaryotes are guests in a prokaryotic world. For example, a human body contains 10 fold more prokaryotes than eukaryotic human cells. Eukaryote and prokaryote biomass on earth is approximately equal.\nThe earliest fossil evidence of animals dates from the Vendian Period (650 to 544 million years ago), with coelenterate-type animals that left traces of their soft bodies in shallow-water sediments. The first mass extinction ended that period, but during the Cambrian Period which followed, an explosion of new forms began the evolutionary radiation that produced most of the major groups, or phyla, known today.','Whitman, Coleman, and Wiebe, Prokaryotes: The unseen majority, Proc. Natl. Acad. Sci. USA, Vol. 95, pp. 6578–6583, June 1998\nCiccarelli FD, Doerks T, von Mering C, Creevey CJ, Snel B, Bork P (2006). \"Toward automatic reconstruction of a highly resolved tree of life\". Science 311 (5765): 1283–7.\nCavalier-Smith, T. (1998). \"A revised six-kingdom system of life\". Biological Reviews of the Cambridge Philosophical Society 73 (3): 203–266.\nThomas Cavalier-Smith (2006). \"Protist phylogeny and the high-level classification of Protozoa\". European Journal of Protistology 39 (4): 338–348.\n',2,'2018-03-23 18:01:02'),(2,'Archaea','Carl Woese et al. 1977','Archaea or Archaebacteria is a major division of living organisms, as well as the name of the members of this group, which in singular form are known as archaeon, archaeum, or archaean.Like bacteria, archaea are single-celled organisms lacking nuclei and are therefore prokaryotes.Archaea comes from the Greek αρχαία, meaning \"ancient ones.\" These \"living fossils\" are genetically and metabolically very different from other organisms. One of the reasons Carl Woese introduced the three-domain taxonomic scheme in 1990 was to emphasize the separation of prokaryotes into two groups, the Bacteria and Archaea, because of the unique nature of the archaea.Archaea were originally described in extreme environments, but have since been found in many types of habitat.\nThe enzymes isolated from some extremophile archaea have proven to be of great use in the biotechnology industry, able to function under conditions that would denature enzymes taken from most \"normal\" organisms.Archea are single celled. They are prokaryotic, have no nucleus, and have one circular chromosome.Individual archaeans range from 0.1 μm to over 15 μm in diameter, and some form aggregates or filaments up to 200 μm in length. They occur in various shapes, such as spherical, rod-shape, spiral, lobed, or rectangular. Archaea have no murein in their cell walls. Recently, a species of flat, square archaean that lives in hypersaline pools has been discovered (Burns et al. 2004).\nMany archaeans are extremophiles (thrive in or require \"extreme\" conditions that would exceed optimal conditions for growth and reproduction in the majority of organisms). They can survive and thrive at even relatively high temperatures, often above 100°C, as found in geysers, black smokers, and oil wells. Others are found in very cold habitats or in highly-saline, acidic, or alkaline water. However, other archaeans are mesophiles (thrive at moderate temperatures) and have been found in environments like marshland, sewage, sea water, and soil. Many methanogenic archaea are found in the digestive tracts of animals such as ruminants, termites, and humans.Archaea are similar to other prokaryotes in most aspects of cell structure and metabolism. However, their genetic transcription and translation—the two central processes in molecular biology—do not show many typical bacterial features, and are in many aspects similar to those of eukaryotes. For instance, archaean translation uses eukaryotic-like initiation and elongation factors, and their transcription involves TATA-binding proteins and TFIIB as in eukaryotes. Many archaeal tRNA and rRNA genes harbor unique archaeal introns, which are neither like eukaryotic introns, nor like bacterial (type I and type II) introns.\nLike bacteria and eukaryotes, archaea possess glycerol-based phospholipids. However, three features of the archaeal lipids are unusual:The archaeal lipids are unique because the stereochemistry of the glycerol is the reverse of that found in bacteria and eukaryotes. This is strong evidence for a different biosynthetic pathway.Most bacteria and eukaryotes have membranes composed mainly of glycerol-ester lipids, whereas archaea have membranes composed of glycerol-ether lipids. Even when bacteria have ether-linked lipids, the stereochemistry of the glycerol is the bacterial form. These differences may be an adaptation on the part of Archaea to hyperthermophily. However, it is worth noting that even mesophilic archaea have ether-linked lipids.Archaeal lipids are based upon the isoprenoid sidechain. This is a five-carbon unit that is also common in rubber and as a component of some vitamins common in bacteria and eukaryotes. However, only the archaea incorporate these compounds into their cellular lipids, frequently as C-20 (four monomers) or C-40 (eight monomers) side-chains. In some archaea, the C-40 isoprenoid side-chain is actually long enough to span the membrane, forming a monolayer for a cell membrane with glycerol phosphate moieties on both ends. Although dramatic, this adaptation is most common in the extremely thermophilic archaea.Although not unique, the archaeal cell walls are also unusual. For instance, the cell walls of most archaea are formed by surface-layer proteins or an S-layer. S-layers are common in bacteria, where they serve as the sole cell-wall component in some organisms (like the Planctomyces) or an outer layer in many organisms with peptidoglycan. With the exception of one group of methanogens, archaea lack a peptidoglycan wall (and in the case of the exception, the peptidoglycan is very different from the type found in bacteria).Archaeans also have flagella that are notably different in composition and development from the superficially similar flagella of bacteria. Bacterial flagella is a modified type III secretion system, while archeal flagella resemble type IV pilli, which use a sec dependent secretion system somewhat similar to but different from type II secretion system.','Burns, D. G., H. M. Camakaris, P. H. Janssen, and M. L. Dyall-Smith. 2004. Cultivation of Walsby\'s square haloarchaeon. FEMS Microbiol Lett. 238(2): 469-473.\nEckburg, P., P. Lepp, and D. Relman. 2003. Archaea and their potential role in human disease. Infect Immun 71(2): 591-596.\nHowland, J. L. 2000. The Surprising Archaea: Discovering Another Domain of Life. Oxford: Oxford University Press. ISBN 0195111834.',1,'2018-03-23 18:01:02'),(3,'Bacteria','Carl Woese et al. 1977','These are part of the large group of organisms commonly called \"bacteria.\" Domain Bacteria contains 5 major groups: proteobacteria, chlamydias, spirochetes, cyanobacteria, and gram-positive bacteria.\n\nGeneral Characteristics:\n•  Unicellular, absorptive-heterotrophic, photoautotrophic, or chemoautotrophic prokaryotes.\n•  Only one set of genes, usually in a single-stranded loop.\n•  Lack sexual reproduction.\n•  Several chemical types of cell walls.\n•  Lack organelles such as centrioles, eukaryotic flagella, cilia, mitochondria, and chloroplasts.	Some bacteria have a unique type of rotating flagellum.\n•  Photoautotrophic species have chlorophyll, but not chloroplasts (which are organelles that are separated form the surrounding cytoplasm by their own membranes).\n\nThe proteobacteria are subdivided into five groups, alpha through epsilon. Species in these groups have a wide range of lifestyles. Some are symbiotic with plants, others live in hot vents deep under the sea, and others yet cause human diseases, such as stomach ulcers (Helicobacter pylori) and food poisoning (Salmonella).\n\nThe other four major groups of bacteria are similarly diverse. Chlamydias are pathogens that live inside host cells, while cyanobacteria are photosynthesizers that make much of Earth\'s oxygen. Spirochetes include both harmless bacteria and harmful ones, like the Borrelia burgdorferi that cause Lyme disease. The same is true of Gram-positive bacteria, which range from probiotic bacteria in yogurt to the Bacillus anthracis that cause anthrax.','Woese, Carl; Fox, George E. (1977). \"Phylogenetic structure of the bacteria domain: the primary kingdoms\". PNAS. 74 (11): 5088–90. Bibcode:1977PNAS...74.5088W. doi:10.1073/pnas.74.11.5088. PMC 432104 Freely accessible. PMID 270744.\n\nCohan FM. What are bacterial species? Annu Rev Microbiol. 2002;56:457-87. Epub\n2002 Jan 30. Review. PubMed PMID: 12142474.\n\nCohan FM, Perry EB. A systematics for discovering the fundamental units of\nbacterial diversity. Curr Biol. 2007 May 15;17(10):R373-86. Review. PubMed PMID: \n17502094.',NULL,'2018-03-23 18:03:26');
