INSERT INTO `especie` VALUES (1,' jannaschii ','Jones 1983','Methanocaldococcus or Methanococcus jannaschii is an autotropic hyperthermophillic organism that belongs to the kingdom of Archaea. They were found to live in extreme environments such as hypothermal vents at the bottom of the oceans in which water reaches boiling temperature or pressure is extremely high (Bult, C.J. et. al., 1996). The evolutionary of these organisms and the biological mechanisms that they use to not only survive but also thrive in such extreme environments are of great interest to current researches.\n\nIn 1982, M. jannaschii was first isolated in the East Pacific Rise, near the western coast of Mexico. The organism was found from a sample sediment taken from a 2600 m deep “white smoker” chimney. Its extreme habitat of temperature between 48oC-94oC, pressure at 200atm, a pH of 5.2-7, and 1.0-5.0% NaCl leads experts to a conclusion that these organisms must have modified and unique adaptations for optimal growth at high temperature, high pressure, and also moderate salinity level (Tsoka et. al, 2003). Moreover, cellular structure of M. jannaschii revealed that they are irregular cocci (have irregular spherical shape). Their motility is by utilizing polar bundles of flagella (Tsoka et. al., 2003). Characteristic to any organism that belongs to the kingdom Archaea, M. jannaschii lacks cell wall; however, they do possess cell envelope that is made up of cytoplasmic membrane and a protein surface layer (S-layer) (Sleytr et. al., 2007).\n\nMethanococcus jannaschii is found at a \"white smoker\", 2600m hydrothermal vent ©Woods Hole Oceanographic Institution\nMethanococcus jannaschii belongs to a specific group called methanogens, or methane producers (Tumbula and Whitman, 1999). Methanogens are physiologically specialized to undergo fueling reactions to produce methane as the end product (Reeve, 1992). They are ultimately autotropic single-celled organisms. Being an autotropic organism, M. jannaschii is strictly anaerobic and uses only carbon dioxide as its sole carbon source. Its main pathway for energy production is through methanogenesis, a process during which hydrogen is used as an energy source to reduce carbon dioxide to methane (Zhu et. al., 2004). Methanogens are extremely important to anaerobic environments because they convert organic compounds into methane, which then rises into the aerobic environment. By doing so, these organisms provide a pathway for compounds that exist in anaerobic environment to escape into the atmosphere, where it acts as a natural gas resource (Reeve, 1992).\n\nM. jannaschii became the first organism in the archaea to have its complete genome sequenced (Bult, C. J. et. al, 1996). Its genomic structure, along with the unique lifestyle, has gradually provided insights into understanding the organism’s adaptations to its extreme habitat. More importantly, the knowledge gained from studying the metabolic processes, the enzymes, and the proteins that are specifically involved in these processes will lead to deeper understanding of the evolution of Archaea. In studying the interaction between M. jannaschii and its environment, many evolution questions about our environments could potentially be answered.\n\nThree characteristic elements that make up the genome of M. jannaschii are: a large circular chromosome, a large-circular extra chromosome, and a small circular extra-chromosome (Bult, C.J. et. al., 1996). Using whole-genome random sequencing, it was found that:\n\n- The large circular chromosome has a length of 1.66 mega base pair. Within the chromosome, there are a total of 1729 protein-coding regions, and the percentage of G+C content is 31.4%.\n\n- The large circular extra-chromosome has a length of 58 kilo base pair. The total protein-coding regions are 45, and the percentage of G+C content is reported as 28.2%.\n\n- The small circular extra-chromosome contains 16.5 kilo base pair. The predicted protein-coding regions are 12, and the G+C content percent is 28.9%.\n\nThe genome structure of Methanococcus jannaschii finally provided solid support for the hypothesis that Archaea is indeed a separate domain of life from Bacteria and Eukarya, and that Archaea is more closely related to Eukarya. This hypothesis was made several years before genome sequencing even existed (Tsoka et. al., 2003). Although the M. jannaschii genome is quite small compared to the genome of well-known species such as Eschericia coli (only 40% of E. coli genome), researchers believe that the genome is very specific to the autotropic lifestyle of the organism (Zhu et. al., 2004). Until now, only about 52% of the proteins in the genome have been identified and assigned to functions (Zhu et. al., 2004). However, their hyperthermophillic properties and their special mechanisms to their extreme environments leads to conclusion that these proteins are strictly involved in energy production, specifically methanogenesis, cell division, metabolism, and also maintaining the organism’s lifestyle (Zhu et. al., 2004)\n',1,'Methanogenesis is the main biochemical pathway from which Methanococcus jannaschii obtains energy. This pathway depends of a rich supply of H2 to reduce CO2 to CH4 (Teske et. al., 2003). There are seven steps involved in the pathway, and each step is catalyzed by a specific enzyme (Zhu et. al., 2004). Since these enzymes are synthesized by hyperthermophiles, they are called hyperthermophillic enzymes (Vieille and Zeikus, 2001). Most interestingly, these enzymes are optimally active at high temperatures, temperatures that would denature most enzymatic functions. In the first step of methanogenesis, carbon dioxide is introduced into the pathway, forming formyl-methanofuran (formyl-MF). This step is catalyzed by the enzyme formyl-methanofuran dehydrogenase (FMD), which is a membrane-bound protein complex. The second step of the pathway produces formyl-tetrahydromethanopterin by transferring the formyl group on the formyl-methanofuran. Formyl-MF:H4MPT formyl transferase (FTR) catalyzes this reaction. In the third step, formyl-H4MPT is reduced to methenyl-H4MPT by the removal of a water molecule. The enzyme involved in this step is H4MPT cyclohydrolase (MCH). The next step of the pathway involves two very functionally distinct enzymes that have been proven to be characteristic in the energy-producing metabolism of methanogens. They are coenzyme F420-dependent, N5, N10-methylene-H4MPT dehydrogenase (MTD), and the other is an H2-dependent, H2-forming N5-N10-methylene-H4MPT dehydrogenase (HMD). The product molecule in this pathway is methylene-H4MPT. N5, N10-methylene-H4MPT reductase (MER) is also a coenzyme F420-dependent, and in the fifth step, it catalyzes the production of methyl-H4MPT from methylene-H4MPT. Under rich hydrogen condition, this enzyme was shown to be highly expressed. In the sixth step, methyl S-coenzyme M is synthesized with the catalysis of the transmembrane enzyme complex, N5-methyl-H4MPT:Coenzyme M methyltransferase (MTR). This enzyme has proven to be extremely important in conserving energy for Methanococcus jannaschii. When MTR transfers a methyl group to conenzyme M, it also creates a proton gradient across the membrane by acting as a primary sodium pump. The Na+/H+ antiporter serves to aid the formation of methane in the next step. Methane is finally produced in the last step of the pathway by methyl conenzyme M reductase.\n','In studying anaerobic microbial communities and their interaction, the sulfate reduction, methanogenesis, and anaerobic methane oxidation are often of great interest not only because there is a close relationship between these pathways, but also because they serve as potential genomic markers to study the evolution of the biochemical pathways of organisms that live in these extreme environments (environments that are believed to resemble that of the ancient Earth’s biosphere). Sulfate reduction and methanogenesis are both anaerobic pathways that convert bacterial organic products during fermentation or degradation to CO2 and methane (Teske et. al., 2003). The availability of sulfate determines the amount of sulfate-reducing organisms. When there is a depletion of sulfate, methanogenic archaea become the dominated species, metabolizing CO2 and H2 to produce methane (Teske et. al., 2003). If methane and sulfate both exist at the same time, anaerobic methane oxidation takes place; this is a process during which methane is oxidized to CO2, using sulfate as the electron acceptor (Teske et. al., 2003). These processes and their interactions become extremely crucial to the hydrothermal vent microbial community because the products of one process become the substrates for other organisms undergoing other biochemical pathways.\nIn methanogenesis, many substrates for Methanococcus jannaschii such as CO2, formate, and acetate are formed by fermentative bacteria that live in anaerobic environments (Reeve, 1992). By converting these compounds to a gaseous product, methane, Methanococcus jannaschii, or methanogens in general, provide a pathway for these organic compounds to escape from the hydrothermal vents into aerobic environments (Teske et. al, 2003). Thus, methanogenesis and the organisms that use this pathway are extremely important in the carbon cycle. A small portion of methane is used by anaerobic methane oxidizing organisms; however, a large portion of it escapes into the atmosphere, where it serves as a very potent greenhouse gas (Zhu et. al, 2004). Even though methane is a potential energy source, the vast amount of methane produced within the past few years have raised many concerns on the Earth’s atmosphere (Zhu et. al., 2004). The increasing amount of methane released in the ocean and in the atmosphere have had some implications on the increasing fuel-burning rate, as well as the increasing concentration of carbon dioxide that humans release. These facts contribute to people’s knowledge about the human damaging effects on global warming that we are now suffering from.','Bult, C.J., White, O., Olsen, G.J., Zhou, L., Fleischmann, R.D., Sutton, G.G., et al. “Complete genome sequence of the methanogenic archaeon, Methanococcus jannaschii.” Science 1996. Volume 273: 1058–1073.\nGraham, D., Xu, H., and White, R. “Identification of coenzyme M biosynthetic phosphosulfolactate synthase: a new family of sulfonate-biosynthesizing enzymes.” J Biol Chem. 2002. Volume 277(16):13421-9.\nTsoka, S., Simon, D., and Ouzounis, C., “Automated Metabolic Reconstruction for Methanococcus jannaschii.” Archaea. 2004. Volume 1: 223-229.\nTumbula, D., and Whitman. W., “Genetics of Methanococcus: possibilities for functional genomics in Archaea.” Molecular Microbiology 1999. Volume 33: 1-7.\n',1),(2,'ghanensis',' Cleenwerck et al. 2007 ','Cells are Gram-negative rods, approximately 0.8 mm wide\nand 1.5–2.5 mm long. Cells occur singly or in pairs. Oxidasenegative.\nCatalase-positive. Strictly aerobic. On MYP agar,\ncolonies are beige, round, convex, smooth and shiny and\napproximately 0.8 mm in diameter after incubation at 28 uC\nfor 4 days. Ethanol is oxidized to acetic acid. Gluconic acid\nis produced from glucose. Unable to produce 2-ketogluconic\nacid, 5-ketogluconic acid or 2,5-diketogluconic acid\nfrom glucose. C18 : 1v7c is the predominant fatty acid\n(approx. 50 %); other fatty acids in significant amounts are\nC16 : 0 (10–16 %), C16 : 0 2-OH (9–11 %), C14 : 0 2-OH\n(5–7 %), C14 : 0 (4–5 %) and C19 : 0 cyclo v8c (5–10 %).\nAble to grow on yeast extract with 30 % glucose, on glycerol\n(although weakly), but not on maltose or methanol. Unable\nto grow with ammonium as sole nitrogen source and ethanol\nas carbon source. The G+C content of the DNA varies from\n56.9 to 57.3 mol%. The DNA G+C content of the type strain\nis 57.3 mol%. Can be differentiated genotypically from other\nspecies of the genus Acetobacter by DNA–DNA hybridization\nand (GTG5)-PCR fingerprinting.',2,'Acetobacter is an obligatory aerobic, nitrogen-fixing bacteria that is known for producing acid as a result of metabolic processes. While all nitrogen-fixing bacteria contain nitrogenase in order to utilize atmospheric nitrogen gas as a source for metabolic biosynthesis, different nitrogen-fixing microorganisms protect the oxygen-sensitive microorgansims from oxygen exposure in different ways. A. diazotrophicus has been called interesting because it carries out nitrogen fixation under aerobic conditions. It needs oxygen for the production of large quantities of ATP required for nitrogen fixation; however, little is known about the mechanism or system that protects the nitrogenase under aerobic conditions. ','Acetobacter bacteria can be found in symbiotic relationships with many different plants, such as sugarcane and coffee plants, as well as in fermenting vinegar. Endophytes are prokaryotes that associate with plants by colonizing their internal tissues. Many of these bacteria have been observed to promote plant growth, but the mechanisms behind this relationship are not yet fully understood. ','Cleenwerck I, Camu N, Engelbeen K, De Winter T, Vandemeulebroecke K, De Vos P,\nDe Vuyst L. Acetobacter ghanensis sp. nov., a novel acetic acid bacterium\nisolated from traditional heap fermentations of Ghanaian cocoa beans. Int J Syst \nEvol Microbiol. 2007 Jul;57(Pt 7):1647-52. PubMed PMID: 17625210.\nIlleghems K, Pelicaen R, De Vuyst L, Weckx S. Assessment of the contribution\nof cocoa-derived strains of Acetobacter ghanensis and Acetobacter senegalensis to\nthe cocoa bean fermentation process through a genomic approach. Food Microbiol.\n2016 Sep;58:68-78. doi: 10.1016/j.fm.2016.03.013. Epub 2016 Mar 29. PubMed PMID: \n27217361.',5);
