INSERT INTO `familia` VALUES (1,' Methanocaldococcaceae','Whitman et al. 2002','The Methanocaldococcaceae are a family of microbes within the order Methanococcales. It consists of two genera: Methanocaldococcus (type genus) and Methanotorris.\nThis family of thermophilic and neutrophilic to slightly acidophilic methanogens belongs to the order Methanococcales. The members are coccoid in shape, are generally motile, and have a very short generation time ranging from 25 to 45 min under optimal conditions. Methanogenesis from H2/CO2 is the sole energy-generating process, and all species are capable of chemolithoautotrophic growth. Members of the Methanocaldococcaceae have been found associated with marine hydrothermal vent areas.','Judicial Commission of the International Committee on Systematics of Prokaryotes (2005). \"The nomenclatural types of the orders Acholeplasmatales, Halanaerobiales, Halobacteriales, Methanobacteriales, Methanococcales, Methanomicrobiales, Planctomycetales, Prochlorales, Sulfolobales, Thermococcales, Thermoproteales and Verrucomicrobiales are the genera Acholeplasma, Halanaerobium, Halobacterium, Methanobacterium, Methanococcus, Methanomicrobium, Planctomyces, Prochloron, Sulfolobus, Thermococcus, Thermoproteus and Verrucomicrobium, respectively. Opinion 79\". Int. J. Syst. Evol. Microbiol. 55 (Pt 1): 517–518. doi:10.1099/ijs.0.63548-0. PMID 15653928.\n\nBalch WE; Fox GE; Magrum LJ; Woses CR; et al. (1979). \"Methanogens: reevaluation of a unique biological group\". Microbiol. Rev. 43 (2): 260–296. PMC 281474 Freely accessible. PMID 390357.','2018-03-12 00:14:08',NULL),(2,'Acetobacteraceae','Henrici 1939','Acetic acid bacteria comprise a widespread group of Gram-negative, obligately aerobic rods. They occur mainly in sugary, acidic and alcoholic habitats and have been studied extensively, since they can play a positive, neutral or detrimental role in foodstuffs and beverages. Some species of the Acetobacteraceae play a key role in the industrial manufacture of vinegar. The following genera belong to this family: Acetobacter (type genus), Acidomonas, Asaia, Gluconacetobacter, Gluconobacter and Kozakia. The names Acetobacter and Gluconobacter are known in literature since 1898 and 1935, respectively, whereas the other genus names were published after 1989.\n\nAll members of the Acetobacteraceae are obligately aerobic and their metabolism is strictly respiratory with oxygen as the terminal electron acceptor.\n\nFor centuries, the Acetobacteraceae is known as a family that harbors many species of organisms of biotechnological importance for industry. Nonetheless, since 1988 representatives of this family have also been described as nitrogen fixing bacteria able to plant growth promotion by a variety of mechanisms. Nitrogen fixation is a biological process that guarantees that the atmospheric\nNitrogen fixation is a biological process that guarantees that the atmospheric N2 is incorporated into organic matter by several bacterial groups. Most representatives of this group, also known as diazotrophic, are generally associated with soil rhizosphere of many plants and also establishing a more specific association living inside roots, leaves, and others plants tissues as endophyte. Their roles as plant growth-promoting microorganisms are generally related to increase in plant biomass, phosphate and other mineral solubilization, and plant pathogen control','Family Acetobacteraceae\". List of Prokaryotic Names with Standing (LPSN). Retrieved 16 January 2016.\n Raspor P; Goranovic D (2008). \"Biotechnological applications of acetic acid bacteria\". Critical Reviews in Biotechnology. 28 (2): 101–124. doi:10.1080/07388550802046749. PMID 18568850.\n Gillis M; De Ley J (January 1980). \"Intra- and Intergenic Similarities of the Ribosomal Ribonucleic Acid Cistrons of Acetobacter and Gluconobacter\". International Journal of Systematic and Evolutionary Microbiology. 30: 7–27. doi:10.1099/00207713-30-1-7.','2018-03-16 10:57:40',NULL);
