INSERT INTO `filo` VALUES (1,'Euryarchaeota','Woese, Kandler & Wheelis, 1990','Euryarchaeota (Greek for \"broad old quality\") is a phylum of archaea. The Euryarchaeota are highly diverse and include methanogens, which produce methane and are often found in intestines, halobacteria, which survive extreme concentrations of salt, and some extremely thermophilic aerobes and anaerobes. They are separated from the other archaeans according to small subunit r RNA.  This system differs from that of Margulis and Schwartz (1998) in that we include the Thermoplasmobacteria , Archaeglobus (and its relatives), and Methanopyrus in this kingdom, an association which is borne out by molecular data (e.g. Gao and Gupta 2007).  This system roughly follows that of Garrity et al. (2001) except that we have raised their classes (all of which represent deeply branching lines) to the level of phylum.\n\nGao and Gupta (2007), who suggested a phylogeny based on comparisons of 31 proteins, is quite different in its structure.  Their analysis confirmed that Halobacteria and Thermoplasmobacteria  were monophyletic.  However, the Methanobacteria form two very different groups, which if true, would make the methanogens polyphyletic. So, we adopt this system with a cautionary note.\n\nThe Euryarchaeota are diverse in appearance and metabolic properties. The phylum contains organisms of a variety of shapes, including both rods and cocci. Euryarchaeota may appear either gram-positive or gram-negative depending on whether pseudomurein is present in the cell wall. Euryarchaeota also demonstrate diverse lifestyles, including methanogens, halophiles, sulfate-reducers, and extreme thermophiles.\n\n\n\n','Whitman WB; Boone DR; Koga Y (2001). \"Family II. Methanocaldococcaceae fam. nov.\". In DR Boone; RW Castenholz. Bergey\'s Manual of Systematic Bacteriology Volume 1: The Archaea and the deeply branching and phototrophic Bacteria (2nd ed.). New York: Springer Verlag. p. 169. ISBN 978-0-387-98771-2.','2018-03-12 00:28:51',NULL),(2,'Proteobacteria','Stackebrandt et al., 1988','Proteobacteria is a major phylum of gram-negative bacteria. They include a wide variety of pathogens, such as Escherichia, Salmonella, Vibrio, Helicobacter, Yersinia, Legionellales, and many other notable genera. Others are free-living (non-parasitic), and include many of the bacteria responsible for nitrogen fixation.\n\nCarl Woese established this grouping in 1987, calling it informally the \"purple bacteria and their relatives\".Because of the great diversity of forms found in this group, it was named after Proteus, a Greek god of the sea capable of assuming many different shapes and is not named after the genus Proteus.\n\nAll \"Proteobacteria\" are gram-negative (though some may stain Gram-positive or Gram-variable in practice), with an outer membrane mainly composed of lipopolysaccharides. Many move about using flagella, but some are nonmotile or rely on bacterial gliding. The latter include the Myxobacteriales, an order of bacteria that can aggregate to form multicellular fruiting bodies. Also, a wide variety in the types of metabolism exists. Most members are facultatively or obligately anaerobic, chemolithoautotrophic, and heterotrophic, but numerous exceptions occur. A variety of genera, which are not closely related to each other, convert energy from light through photosynthesis.\n\n\"Proteobacteria\" are associated with the imbalance of microbiota of the lower reproductive tract of women. These species are associated with inflammation. Protobacteria are part of a normal, healthy placental microbiome.\n\nThe group is defined primarily in terms of ribosomal RNA (rRNA) sequences. The \"Proteobacteria\" are divided into six classes with validly published names, referred to by the Greek letters alpha through epsilon and the Acidithiobacillia and Oligoflexia. These were previously regarded as subclasses of the phylum, but they are now treated as classes. These classes are monophyletic.',' Stackebrandt, E.; Murray, R. G. E.; Truper, H. G. (1988). \"Proteobacteria classis nov., a Name for the Phylogenetic Taxon That Includes the \"Purple Bacteria and Their Relatives\"\". International Journal of Systematic Bacteriology. 38 (3): 321–325. doi:10.1099/00207713-38-3-321.\nGarrity, G. M., Bell, J. A. & Lilburn, T. (2005). Phylum XIV. Proteobacteria phyl. nov. In: Bergey’s Manual of Systematic Bacteriology, 2nd edn, vol. 2 (The Proteobacteria), part B (The Gammaproteobacteria), p. 1. Edited by D. J. Brenner, N. R. Krieg, J. T. Staley & G. M. Garrity. New York: Springer.','2018-03-16 10:35:47',NULL);
