INSERT INTO `genero` VALUES (1,'Methanocaldococcus','Whitman 2002','Methanocaldococcus or Methanococcus is a genus of coccoid methanogens of the family Methanococcaceae. They are all mesophiles, except the thermophilic M. thermolithotrophicus and the hyperthermophilic M. jannaschii. \nIrregular cocci, 1.0–2.0 µm in diameter during balanced growth. Cells from older cultures or colonies are extremely irregular. Cells lose integrity during Gram staining and lyse completely within 10 s when suspended in either distilled water or 0.01% sodium dodecylsulfate. Motile, by means of polar tufts of flagella. Obligately anaerobic. Mesophilic (temperature optima: 35–40°C). pH optimum between 6 and 8. NaCl required for growth, optimal concentrations 0.5–4% (w/v). Obligately methanogenic; H2 and formate serve as electron donors. Acetate, methanol, and methylamines are not substrates for methanogenesis. Alcohols, including isopropanol, are not substrates for methanogenesis. With one exception, all species grow autotrophically in mineral medium. Amino acids and acetate are stimulatory for some species. Nitrogen sources include ammonium, N2 gas and alanine. Storage materials include glycogen. Organisms are found in salt-marsh, marine, and estuarine sediments.','Tumbula, D. L. and Whitman, W. B. (1999), Genetics of Methanococcus: possibilities for functional genomics in Archaea. Molecular Microbiology, 33: 1–7. doi:10.1046/j.1365-2958.1999.01463.\nKeswani J; Orkand S; Premachandran U; Mandelco L; et al. (1996). \"Phylogeny and taxonomy of mesophilic Methanococcus spp. and comparison of rRNA, DNA hybridization, and phenotypic methods\". Int. J. Syst. Bacteriol. 46 (3): 727–735. doi:10.1099/00207713-46-3-727. PMID 8782682\nAllen, Kylie; Wegener, Gunter; White, Robert (8 August 2014). \"Discovery of Multiple Modified F430 Coenzymes in Methanogens and Anaerobic Methanotrophic Archaea Suggests Possible New Roles for F430 in Nature\". Applied and Environmental Microbiology. 80 (20): 6403–6412. doi:10.1128/AEM.02202-14. PMC 4178637 Freely accessible. PMID 25107965.','2018-03-16 07:29:04',NULL),(2,'Acetobacter','Beijerinck 1898','Acetobacter is a genus of acetic acid bacteria. Acetic acid bacteria are characterized by the ability to convert ethanol to acetic acid in the presence of oxygen. Of these, the genus Acetobacter is distinguished by the ability to oxidize lactate and acetate into carbon dioxide and water.\nThese bacteria can be isolated from coffee plants or sugarcane, are acid-producing, nitrogen-fixing bacteria. In fact, the A. diazotrophicus-sugarcane relationship, first observed in Brazil, was the first report of a beneficial symbiotic relationship between grasses and bacteria through nitrogen fixation. Nitrogen-fixing bacteria are important in modern agriculture - exploiting these bacteria would decrease the present dependency on nitrogen fertilizers, which would have positive results for the ecosystem and the health of humans and other animals. Other strains can be found in samples from Japanese rice vinegar (komesu) or unpolished rice vinegar (kurosu).\n\nAcetobacter is an obligatory aerobic, nitrogen-fixing bacteria that is known for producing acid as a result of metabolic processes. While all nitrogen-fixing bacteria contain nitrogenase in order to utilize atmospheric nitrogen gas as a source for metabolic biosynthesis, different nitrogen-fixing microorganisms protect the oxygen-sensitive microorgansims from oxygen exposure in different ways. A. diazotrophicus has been called interesting because it carries out nitrogen fixation under aerobic conditions. It needs oxygen for the production of large quantities of ATP required for nitrogen fixation; however, little is known about the mechanism or system that protects the nitrogenase under aerobic conditions. A. diazotrophicus is a plant endophyte and has been said to be capable of excreting about half of its fixed nitrogen in a form that plants can use.','Flores-Encarnacion, M., M. Contreras-Zentella, L. Soto-Urzua, G. R. Aguilar, B. E. Baca, and J. E. Escamilla. 1999. \"The respiratory system and diazotrophic activity of Acetobacter diazotrophicus PAL5.\" Journal of Bacteriology, vol. 181, no. 22. American Society for Microbiology. (6987-6995)\nCleenwerck I; Vandemeulebroecke D; Janssens D; Swings J (2002). \"Re-examination of the genus Acetobacter, with descriptions of Acetobacter cerevisiae sp. nov. and Acetobacter malorum sp. nov\". International Journal of Systematic and Evolutionary Microbiology. 52: 1551–1558. doi:10.1099/00207713-52-5-1551. PMID 12361257. Retrieved 23 December 2015.','2018-03-16 10:29:32',NULL);
