INSERT INTO `orden` VALUES (1,'Methanococcales','Balch and Wolfe 1981','The order Methanococcales is composed of two families, Methanocaldococcaceae and Methanococcaceae, which are distinguished by 16S rRNA sequence similarities below 93% and differences in growth temperatures. The Methanocaldococcaceae are all hyperthermophilic, while the Methanococcaceae are extremely thermophilic or mesophilic. Members of this order are all capable of forming methane by CO2 reduction with H2. Many species can use formate as an alternative electron donor. Most species can grow autotrophically.The sequencing of representative genes of the methane-producing archaea in the order Methanococcales suggests that this lineage is ancient and possesses a high degree of genetic diversity. For example, the mesophile Methanococcus maripaludis and hyperthermophile Methanocaldococcus jannaschii represent the range of diversity within this group. The sequence similarity of their 16S rRNA genes is 88%. Likewise, homologous open reading frames in these two organisms typically possess 60–80% amino acid sequence identity (W. B. Whitman, unpublished observation). For comparison, genes within Escherichia and Yersinia possess a comparable level of similarity.\n\nIn spite of this apparent genetic diversity, the phenotypes of members of the Methanococcales are similar. They have all been isolated from marine habitats and require sea salts for optimal growth. They are all obligately anaerobic methane-producers and use carbon dioxide as the electron acceptor.',' EUZÉBY (J.P.) and TINDALL (B.J.): Nomenclatural type of orders: corrections necessary according to Rules 15 and 21a of the Bacteriological Code (1990 Revision) and designation of appropriate nomenclatural types of classes and subclasses. Request for an Opinion. Int. J. Syst. Evol. Microbiol. 2001, 51, 725-727. ','2018-03-12 00:43:46',NULL),(2,'Rhodospirillales','Garrity et al. 2005','Rhodospirillales. This is a clade within the larger bacterial group known as the Alphaproteobacteria, other members of which include the disease-causing rickettsiae (thought to be close relatives of the ancestors of eukaryote mitochondria) and the nitrogen-fixing bacteria found in legume nodules. Rhodospirillales species are commonly found in fresh water, though some significant species have been found in other habitats. Many (but far from all) species of Rhodospirillales contain a chlorophyll-like pigment called bacteriochlorophyll a that functions like chlorophyll in catalysing photosynthesis. They also often contain other photosynthetic pigments, carotenoids, that are red in colour: hence the common use of prefixes such as \'rhodo-\' and \'roseo-\' in genus names in this group. Most photosynthetic Rhodospirillales differ from plants in being photoheterotrophs rather than photoautotrophs: that is, they cannot use carbon dioxide alone as the source of carbon in photosynthesis, and require other carbon sources (Rhodospirillum can grow photoautotrophically if conditions are optimal). Rather than using water as an electron donor, photosynthetic Rhodospirillales generally use other donors such as sulfide or hydrogen.\n\nThe members of the Rhodospirillales are divided between two families, the Rhodospirillaceae and Acetobacteraceae (Garrity et al. 2005). The majority of members of the Rhodospirillaceae are spiral in shape and grow in anoxic or microaerobic conditions. Acetobacteraceae, in contrast, are most often coccus- or rod-shaped and aerobic. Non-photosynthetic members of Rhodospirillaceae include the nitrogen-fixing genus Azospirillum, often found living in the soil or in association with plants (though, unlike the more familiar nitrogen-fixing genus Rhizobium, Azospirillum is not found specifically in association with root nodules). Also noteworthy is the genus Magnetospirillum, specimens of which possess a row of magnetite-containing bodies called magnetosomes down one side of the cell. These magnetic bodies are presumed to aid the bacterium in navigation relative to the earth\'s magnetic field. Magnetospirillum can be drawn from sediment through the use of a bar magnet; when observed under a microscope close to a magnet, they can be seen to swim parallel to the magnetic field lines. A cell suspension dropped onto a magnetic stirrer will be seen to flicker, as the cells change their direction of movement (and hence the direction of light scattering) to follow the spinning field.\n\nNon-photosynthetic members of the Acetobacteraceae include the acetic acid bacteria (hence the name of the family). These gain energy by converting ethanol to acetic acid or, in more general terms, alcohol to vinegar. Some genera, such as Acetobacter and Acidomonas, are able to further oxidise the acetate produced to water and carbon dioxide; others, such as Gluconobacter, do not do so. One particularly distinctive genus in the Acetobacteraceae is Stella, species of which are found in soil and animal faecal matter. Cells of Stella are flat and, as suggested by their name, star-shaped with six points. Division of Stella involves the growth of a cross-wall down the midline of the cell, with each daughter cell retaining three of the parent\'s points to which they add three new points.','Garrity, George M.; Brenner, Don J.; Krieg, Noel R.; Staley, James T. (eds.) (2005). Bergey\'s Manual of Systematic Bacteriology, Volume Two: The Proteobacteria, Part C: The Alpha-, Beta-, Delta-, and Epsilonproteobacteria. New York, New York: Springer. ISBN 978-0-387-24145-6.','2018-03-16 10:51:41',NULL);
